import { Vector2 } from './vector2';
import { Mathf } from './mathf';

export class Matrix3x3 {
  protected _matrix: number[][] = [];

  constructor(value?: number[][]) {
    this._matrix = Matrix3x3.identity;
    if (!(value instanceof Array)) return;
    this._matrix = value;
  }

  public get determinant(): number {
    let determinant = 0;

    let left = [
      this._matrix[0][0] * this._matrix[1][1] * this._matrix[2][2],
      this._matrix[0][1] * this._matrix[1][2] * this._matrix[2][0],
      this._matrix[1][2] * this._matrix[1][0] * this._matrix[2][1]
    ];

    let right = [
      this._matrix[2][0] * this._matrix[1][1] * this._matrix[0][2],
      this._matrix[2][1] * this._matrix[1][2] * this._matrix[0][0],
      this._matrix[2][2] * this._matrix[1][0] * this._matrix[0][2]
    ];

    determinant = left[0] + left[1] + left[2] - (right[0] + right[1] + right[2]);
    console.log(determinant);

    return determinant;
  }

  public get inverse(): number[][] {
    let preInverse = Matrix3x3.identity;
    let matrix = this._matrix;
    let determinant = this.determinant;
    let a11 = 0,
      a12 = 0,
      a13 = 0;
    let a21 = 0,
      a22 = 0,
      a23 = 0;
    let a31 = 0,
      a32 = 0,
      a33 = 0;

    a11 = (matrix[1][1] * matrix[2][2] - matrix[2][1] * matrix[1][2]) * 1;
    a12 = (matrix[1][0] * matrix[2][2] - matrix[2][0] * matrix[1][2]) * -1;
    a13 = (matrix[1][0] * matrix[2][1] - matrix[2][0] * matrix[1][1]) * 1;

    a21 = (matrix[0][1] * matrix[2][2] - matrix[2][1] * matrix[0][2]) * -1;
    a22 = (matrix[0][0] * matrix[2][2] - matrix[0][2] * matrix[2][0]) * 1;
    a23 = (matrix[0][0] * matrix[2][1] - matrix[2][0] * matrix[0][1]) * -1;

    a31 = (matrix[0][1] * matrix[1][2] - matrix[1][1] * matrix[0][2]) * 1;
    a32 = (matrix[0][0] * matrix[1][2] - matrix[1][0] * matrix[0][2]) * -1;
    a33 = (matrix[0][0] * matrix[1][1] - matrix[1][0] * matrix[0][1]) * 1;

    preInverse[0] = [a11, a21, a31];
    preInverse[1] = [a12, a22, a32];
    preInverse[2] = [a13, a23, a33];

    let inverseMatrix = new Matrix3x3(preInverse);
    console.log(inverseMatrix.matrix);
    console.log(a11 * (1 / determinant));

    inverseMatrix = inverseMatrix.multiplyByValue(1 / determinant);
    console.log(inverseMatrix.matrix);

    return inverseMatrix.matrix;
  }

  public getRow(index: number): number[] {
    return this._matrix[index];
  }

  public setRow(index: number, value: number[]) {
    this._matrix[index] = value;
  }

  public getColumn(index: number): number[] {
    let column: number[] = [];
    for (let i = 0; i < 3; i++) {
      column.push(this._matrix[i][index]);
    }
    return column;
  }

  public setColumn(index: number, value: number[]) {
    for (let i = 0; i < value.length; i++) {
      this._matrix[i][index] = value[i];
    }
  }

  public get matrix(): number[][] {
    return this._matrix;
  }

  public multiplyByValue(value: number): Matrix3x3 {
    return Matrix3x3.multiplyValue(this, value);
  }
  static multiplyValue(matrix: Matrix3x3, value: number): Matrix3x3 {
    var result = Matrix3x3.empty;
    for (let i = 0; i < 3; i++) {
      for (let j = 0; j < 3; j++) {
        result[i][j] = matrix._matrix[i][j] * value;
      }
    }
    return new Matrix3x3(result);
  }

  public multiplyByVector(vector: Vector2): Vector2 {
    return Matrix3x3.multiplyVector(this, vector);
  }

  static multiplyVector(matrix: Matrix3x3, vector: Vector2): Vector2 {
    let result = new Vector2();
    let array = matrix.matrix;

    result.x = array[0][0] * vector.x + array[0][1] * vector.y + array[0][2];
    result.y = array[1][0] * vector.x + array[1][1] * vector.y + array[1][2];

    return result;
  }

  public multiplyBy(matrix: Matrix3x3): Matrix3x3 {
    return Matrix3x3.multiply(this, matrix);
  }

  static multiply(matrix: Matrix3x3, other: Matrix3x3): Matrix3x3 {
    var result = Matrix3x3.empty;
    for (let i = 0; i < 3; i++) {
      for (let j = 0; j < 3; j++) {
        result[i][j] = 0;
        for (let k = 0; k < 3; k++) {
          result[i][j] += matrix._matrix[i][k] * other._matrix[k][j];
        }
      }
    }
    return new Matrix3x3(result);
  }

  static get identity(): number[][] {
    return [
      [1, 0, 0],
      [0, 1, 0],
      [0, 0, 1]
    ];
  }

  public static get reflection(): number[][] {
    return [
      [-1, 0, 0],
      [0, -1, 0],
      [0, 0, -1]
    ];
  }

  static get empty(): number[][] {
    return [[], [], []];
  }

  /**
   * return scale matrix to a factor
   */
  public static scale(factor: Vector2) {
    return new Matrix3x3([
      [factor.x, 0, 0],
      [0, factor.y, 0],
      [0, 0, 1]
    ]);
  }

  /**
   * return rotation matrix to a certain radiant
   */
  public static rotate(angle: number) {
    let radians = Mathf.degreesToRadians(angle);
    const cos = Math.cos(radians);
    const sin = Math.sin(radians);
    //console.log(sin);

    let matrix = new Matrix3x3([
      [cos, -sin, 0],
      [sin, cos, 0],
      [0, 0, 1]
    ]);

    return matrix;
  }

  /**
   * return translation matrix to a certain vector
   */
  public static translate(vector: Vector2): Matrix3x3 {
    //console.log(vector);

    return new Matrix3x3([
      [1, 0, vector.x],
      [0, 1, vector.y],
      [0, 0, 1]
    ]);
  }

  public static view(width: number, height: number, scale: number): Matrix3x3 {
    const scaleStep = scale; // Scale every vector * scaleStep
    const centerX = width / 2;
    const centerY = height / 2;
    const flipX = Math.cos(Math.PI); // rotate 180deg / 3.14radian around X-axis

    return new Matrix3x3([
      [scaleStep, 0, centerX],
      [0, flipX * scaleStep, centerY],
      [0, 0, 1]
    ]);
  }

  public static viewCamera(center: Vector2, rotation: number, zoom: number): Matrix3x3 {
    const scaleStep = zoom; // Scale every vector * scaleStep
    let radians = Mathf.radiansToDegrees(rotation);

    const cos = Math.cos(radians);
    const sin = Math.sin(radians); // rotate 180deg / 3.14radian around X-axis

    return new Matrix3x3([
      [cos * scaleStep, -sin, center.x],
      [sin, cos * scaleStep, center.y],
      [0, 0, 1]
    ]);
  }
}
